// @ts-nocheck
import React from "react";
import { Card, Button } from "intelli-ui-components-library";
import { AddIcon, DeleteIcon } from "../../assets/icons";

const CreateParam = () => {
  return (
    <>
      <Card round="round" style={{
        width: "100%"
      }}>
        <Card.CardHeader title="There are no parameters defined for this operation." divider="dark" />
        <Card.CardAction>
          <div>
            <Button
              //   children="Create Parameter"
              size="md"
              variant="contained"
              round="round"
              color="primary"
              //   onClick={handleAddEnum}
              className="mb-2"
              icon={<AddIcon />}
            >
              <span>
                <AddIcon />
              </span>
              Create Parameter
            </Button>
          </div>
        </Card.CardAction>
      </Card>
    </>
  );
};

export default CreateParam;
